function calenderCaller() {
    let datePickers = $(".date-picker");
    for (let e = 0; e < datePickers.length; e++) {
        let t = datePickers[e];
        $(t).persianDatepicker({
            inline: !1,
            viewMode: "day",
            initialValue: !0,
            autoClose: !1,
            position: "auto",
            format: "YYYY/MM/DD",
            onlyTimePicker: !1,
            onlySelectOnDate: !1,
            calendarType: "persian",
            inputDelay: 800,
            observer: !1,
            navigator: { enabled: !0, scroll: { enabled: !0 }, text: { btnNextText: "<", btnPrevText: ">" } },
            toolbox: { enabled: !0, calendarSwitch: { enabled: !1, format: "MMMM" }, todayButton: { enabled: !0, text: { fa: "امروز", en: "Today" } }, submitButton: { enabled: !0, text: { fa: "تایید", en: "Submit" } }, text: { btnToday: "امروز" } },
            timePicker: { enabled: !1, step: 1, hour: { enabled: !0, step: null }, minute: { enabled: !0, step: null }, second: { enabled: !1 }, meridian: { enabled: !1 } },
            dayPicker: { enabled: !0, titleFormat: "YYYY MMMM" },
            monthPicker: { enabled: !0, titleFormat: "YYYY" },
            yearPicker: { enabled: !0, titleFormat: "YYYY" },
            responsive: !0
        })
    }
    let dateTimePickers = $(".date-time-picker");
    for (let e = 0; e < dateTimePickers.length; e++) {
        let t = dateTimePickers[e];
        $(t).persianDatepicker({ inline: !1, viewMode: "day", initialValue: !0, autoClose: !1, position: "auto", format: "HH:mm YYYY/MM/DD", onlyTimePicker: !1, onlySelectOnDate: !1, calendarType: "persian", inputDelay: 800, observer: !1, navigator: { enabled: !0, scroll: { enabled: !0 }, text: { btnNextText: "<", btnPrevText: ">" } }, toolbox: { enabled: !0, calendarSwitch: { enabled: !1, format: "MMMM" }, todayButton: { enabled: !0, text: { fa: "امروز", en: "Today" } }, submitButton: { enabled: !0, text: { fa: "تایید", en: "Submit" } }, text: { btnToday: "امروز" } }, timePicker: { enabled: !0, step: 1, hour: { enabled: !0, step: null }, minute: { enabled: !0, step: null }, second: { enabled: !1 }, meridian: { enabled: !1 } }, dayPicker: { enabled: !0, titleFormat: "YYYY MMMM" }, monthPicker: { enabled: !0, titleFormat: "YYYY" }, yearPicker: { enabled: !0, titleFormat: "YYYY" }, responsive: !0 })
    }
}

calenderCaller();